import styled from "styled-components";

const Wrapper= styled.section`
  padding: 1em;
  padding-top: 4em;
  padding-bottom: 4em;
  background: #9F939D;

  .pagination {
    justify-content: center;
  }

  .list-group-item {
  background: #4c4a58;
  color: #f3e5de;
  }

  .badge {
  background: #c9ada8;
  color: #363636;
  }

  a.page-link {
    text-align: center;
    color: #f3e5de;
    background: #4c4a58;
    border-color: #b4a69f;

  }  
`;

export default Wrapper;
